import React from 'react';
import Calculator from './Calculator';
import Clock from './Clock';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <h1>React Calculator</h1>
      <Calculator />
      <Clock />
    </div>
  );
};

export default App;
